import * as React from 'react';
import Paper from '@mui/material/Paper';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import { styled } from '@mui/material/styles';
import { useParams} from 'react-router-dom';
import { useState, useEffect } from 'react';



const Details = () => {
  const { id } = useParams();

  const [searchRes, setSearchRes] = useState();
  useEffect(() => {
    fetch(`http://localhost:8080/search/${id}`)
      .then(response => response.json())
      .then(data => {

        setSearchRes(data);
      })
      .catch(error => {
        console.error('Error fetching departments:', error);
      });
  }, []);

  const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
    flexGrow: 1,
  }));
  
  // Access the `id` parameter and use it in your component

  return (
    <Stack spacing={{ xs: 1, sm: 2 }} direction="row" useFlexGap flexWrap="wrap">
  <div>
      {searchRes.map(item => (
        <div key={item.id}>
          <h2>File Details</h2>
          <p>File ID: {item.fileId}</p>
          <p>File Name: {item.fileName}</p>
          <p>File Type: {item.fileType}</p>
          <p>Author: {item.author}</p>
          <p>Make Date: {item.makeDate}</p>
          <p>Description: {item.description}</p>

          <h2>Menu Details</h2>
          <p>Menu Name: {item.menu.menuName}</p>

          <h2>Application Details</h2>
          <p>Application Name: {item.menu.application.applicationName}</p>

          <h2>Function Details</h2>
          <p>Function Name: {item.menu.application.function.functionName}</p>

          <h2>Department Details</h2>
          <p>Department Name: {item.menu.application.function.department.departmentName}</p>
        </div>
      ))}
    </div>
</Stack>
  );
};

export default Details;
